import PropTypes from 'prop-types'

export default function Page({ children, cool }) {
  return (
    <div>
      <h1> Im the page component </h1>
      <h3>{cool}</h3>
      {children}
    </div>
  );
}

Page.propTypes = {
 cool: PropTypes.string,
 children: PropTypes.oneOf([
    PropTypes.arrayOf(PropTypes.node),
    PropTypes.node,
 ])
}
